import './Home.scss';


function Home(){
   var category = [
      {
          typefilm: "hd",
          nametypefilm:"PHIM HÀNH ĐỘNG"
      },
      {
          typefilm:"pl",
          nametypefilm:"PHIM PHIÊU LƯU"
      },
      {
          typefilm: "hh",
          nametypefilm: "PHIM HOẠT HÌNH"
      },
      {
          typefilm: "lm",
          nametypefilm: "PHIM LÃNG MẠN"
      },
      {
          typefilm: "kd",
          nametypefilm: "PHIM KINH DỊ"
      }
  ];
    return(
        <div class="row">
          {
            category.map((data,index) => {
              return(
                <div className = {"col-sm-3"} key = {index}>{data.nametypefilm}</div>
              )
            })
          }
        </div>
    )
}

export default Home;
